import android from '../src/Images/';
import event from '../src/Images/IMG_9989.JPG';
import product from '../src/Images/IMG.9988';
import corporate from '../src/Images/IMG_9987.JPG';

const Sdata = [
    {
        imgsrc:wedding,
        title:"Wedding"
    },
    {
        imgsrc:pre_wedding,
        title:"Pre_Wedding"
    },
    {
        imgsrc:corporate,
        title:"Corporate "
    },
    {
        imgsrc:event,
        title:"Event"
    },
    {
        imgsrc:product,
        title:"Product"
    },
    {
        imgsrc:android,
        title:"Android development"
    },
]
export default Sdata
